import PropTypes from 'prop-types';

function Food({name, picture, rating}) {

  return (
  <div>
    <h3>I love {name}</h3> 
    <img src={picture} alt={name} width="400px"/>
    <h3>{rating} / 5</h3> 
  </div>

  );
}

const foodILike = [
  {
    id: 1,
    name: '김치',
    image: 'http://img.choroc.com/newshop/goods/024443/024443_1.jpg',
    rating: 5,
  },
  {
    id: 2,
    name: '피자',
    image: 'https://cdn.dominos.co.kr/admin/upload/goods/20200311_x8StB1t3.jpg',
    rating: 4.2,
  },
  {
    id: 3,
    name: '떡볶이',
    image: 'https://desion.kr/web/product/tiny/202101/7b8394ed298eafcde0ad47a0bc64de83.jpg',
    rating: 3.9,
  },
  {
    id: 4,
    name: '김밥',
    image: 'https://recipe1.ezmember.co.kr/cache/recipe/2016/06/29/e7401296033ab8e4297cd53d71e1bba91.jpg',
    rating: 4.7,
  },

];

function App() {

  return (
    <div>
      <h1>Hello</h1>
      {foodILike.map(dish => (
        <Food key={dish.id} name={dish.name} picture={dish.image} rating={dish.rating}/>
      ))}
    </div>
  );

}

Food.propTypes = {
  name: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number.isRequired,

}

export default App;
